Element::Element()
    : tag_(Tag::kBlobUuid)
{
    data_.blob_uuid = new std::string;
}

Element::~Element()
{
    DestroyActive();
}

void Element::set_blob_uuid(const std::string& blob_uuid)
{
    if (tag_ == Tag::kBlobUuid) {
        *(data_.blob_uuid) = std::move(blob_uuid);
    } else {
        DestroyActive();
        tag_ = Tag::kBlobUuid;
        data_.blob_uuid = new std::string(std::move(blob_uuid));
    }
}
void Element::set_bytes(std::vector<uint8_t> bytes)
{
    if (tag_ == Tag::kBytes) {
        *(data_.bytes) = std::move(bytes);
    } else {
        DestroyActive();
        tag_ = Tag::kBytes;
        data_.bytes = new std::vector<uint8_t>(std::move(bytes));
    }
}
void Element::set_file(FilePtr file)
{
    if (tag_ == Tag::kFile) {
        *(data_.file) = std::move(file);
    } else {
        DestroyActive();
        tag_ = Tag::kFile;
        data_.file = new FilePtr(std::move(file));
    }
}
void Element::set_DEPRECATED_file_system_file(DEPRECATED_FileSystemFilePtr DEPRECATED_file_system_file)
{
    if (tag_ == Tag::kDeprecatedFileSystemFile) {
        *(data_.DEPRECATED_file_system_file) = std::move(DEPRECATED_file_system_file);
    } else {
        DestroyActive();
        tag_ = Tag::kDeprecatedFileSystemFile;
        data_.DEPRECATED_file_system_file = new DEPRECATED_FileSystemFilePtr(std::move(DEPRECATED_file_system_file));
    }
}

void Element::DestroyActive()
{
    switch (tag_) {

    case Tag::kBlobUuid:

        delete data_.blob_uuid;
        break;
    case Tag::kBytes:

        delete data_.bytes;
        break;
    case Tag::kFile:

        delete data_.file;
        break;
    case Tag::kDeprecatedFileSystemFile:

        delete data_.DEPRECATED_file_system_file;
        break;
    }
}

bool Element::Validate(const void* data, mojo::internal::ValidationContext* validation_context)
{
    return Data_::Validate(data, validation_context, false);
}

